import React from "react";
class Welcome extends React.Component
{
    constructor(props)
    {
        super(props)



    }
    render()
    {
        return (
            <div>
                <h1>Hi {this.props.name}</h1>
                <button>Subscribe</button>
            </div>
        )
    }
}
export default Welcome
